import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router } from 'react-router-dom';
import Navigation from 'components/navigation/Navigation';
import './index.css';

const Index = () => (
	<Router>
		<Navigation />
	</Router>
);

ReactDOM.render(
  <Index />,
  document.getElementById('root')
);
